$background-color: #FFFFFF;
$textColor: #061B3A;
$testingColor: grey;
$dotColor: #EBEBEB;
$colorRed: #D82629;

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html{
    font-size: 62.5%;
    font-family: 'Raleway', sans-serif;
}

