.wrapper{
    background: $background-color;
    width: 100%;
    height: 100vh;
}

header{
    display: flex;
    justify-content: space-between;
    align-items: center;

    .gencoLogo{
        width: 11rem;
    }

    .navBar{
        a{
            position: relative;
            font-size: 2rem;
            font-weight: 600;
            color: $textColor;
            text-decoration: none;
            margin: 0 1rem 0.5rem 1rem;
        }
        a:after {
            content: "";
            position: absolute;
            bottom: -3px;
            left: 0;
            height: 3px;
            width: 0%;
            background: $colorRed;
            transition: width 0.3s ease 0s, left 0.3s ease 0s;
        }
        a:hover:after{
            width: 100%;
        }
        .active:after{
            content: "";
            position: absolute;
            bottom: -3px;
            left: 0;
            height: 3px;
            width: 50%;
            background: $colorRed;
        }

        @media only screen and (max-width:1400px){
            display: none;
        }
    }
}
.mainContent{

    .dots{
        margin: -2.5rem 0 0 -2.5rem;
        background-image: radial-gradient($dotColor 5px, transparent 5px);
        background-size: 6rem 6rem;

        @media only screen and (max-width:1200px){
            display: none;
        }
        @media only screen and (max-width:900px){
            display: block;
        }
        @media only screen and (max-width:600px){
            background-image: radial-gradient($dotColor 4px, transparent 4px);
            margin: -2rem 0 0 -2rem;
            background-size: 5rem 5rem;
        }
    }

    .left{
        .slug{
            font-weight: 800;
            padding-top: 8rem;
            max-height: max-content;

            @media only screen and (max-width: 1400px) {
                padding-top: 5rem;
                font-weight: 700;
            }
            @media only screen and (max-width: 1300px) {
                padding-top: 5rem;
            }
            @media only screen and (max-width: 1200px) {
                padding-top: 0rem;
                align-self: center;
                justify-self: center;
            }

            @media only screen and (max-width: 600px) {
                margin-top: 1.5rem;
                align-self: flex-start;
            }
            p{
                width: max-content;
                padding: 1rem;
                color: $dotColor;
                background-color: $textColor;
                border-radius: 1rem;
                box-shadow: -1px 1px 10px $textColor;
                font-size: 6rem;

                @media only screen and (max-width: 1500px) {
                    font-size: 5.5rem;
                }
                @media only screen and (max-width: 1400px) {
                    font-size: 4.5rem;
                }
                @media only screen and (max-width: 1300px) {
                    font-size: 4rem;
                }
                @media only screen and (max-width: 800px) {
                    font-size: 3rem;
                }
            }  
        .firstPart{
            position: relative;
            z-index: 3;
        }    
        .secondPart{
            position: relative;
            margin-left: 10.5rem;
            z-index: 3;
            margin-top: -1rem;

                @media only screen and (max-width: 1500px) {
                    margin-left: 9.5rem;
                }
                @media only screen and (max-width: 1400px) {
                    margin-left: 7rem;
                }
                @media only screen and (max-width: 1300px) {
                    margin-left: 7rem;
                }
            } 
        }

        .arrows{
            display: flex;
            justify-content: flex-end;
            margin-bottom: 2%;
            margin-right: 1.9rem;
            width: max-content;
            height: max-content;
            align-self: flex-end;
            justify-self: flex-end;
            background-color: white;
            cursor: pointer;

            @media only screen and (max-width:1400px) {
                margin-bottom: 3%;
            }

            @media only screen and (max-width:1200px){
                z-index: 1;
                background-color: transparent;
                width: 100%;
                margin-bottom: 0;
                margin-right: 0;
                padding: 0 1.5rem 0 1.5rem;
                align-self: center;
                justify-self: center;
                justify-content: space-between;

                a{
                    background-color: $textColor;
                    padding: 7px 0 7px 0;
                    border-radius: .5rem ;
                }

            }

            img{
                width: 4rem;
                
                @media only screen and (max-width:1400px) {
                    width: 3rem;
                }
                @media only screen and (max-width:800px) {
                    width: 2.5rem;
                }
                @media only screen and (max-width:415px) {
                    width: 1.9rem;
                }
            }
            .arrowOne{
                filter: invert(13%) sepia(6%) saturate(6811%) hue-rotate(178deg) brightness(94%) contrast(106%);                
                transform: rotate(180deg);
                left: 0;
                transition: left .15s;

                &:hover{
                    position: relative;
                    left: -3px;
                }

                @media only screen and (max-width: 1200px){
                    filter: invert(99%) sepia(5%) saturate(125%) hue-rotate(213deg) brightness(113%) contrast(84%);

                    &:hover{
                        left: 0px;
                    }
                }
            }
            .arrowTwo{
                filter: invert(13%) sepia(6%) saturate(6811%) hue-rotate(178deg) brightness(94%) contrast(106%);                
                margin-left: 6.5rem;
                left: 0;
                transition: left .15s;

                &:hover{
                    position: relative;
                    left: 3px;
                }

                @media only screen and (max-width: 1200px) {
                    margin-left: 0;
                    filter: invert(99%) sepia(5%) saturate(125%) hue-rotate(213deg) brightness(113%) contrast(84%);

                    &:hover{
                        left: 0px;
                    }
                }
                
            }
        }

        .exes{
            width: 18px;
            height: 18px;
            fill: $textColor;

            .ex1{
                position: relative;
                top: 5.6rem;
                left: 29.6rem;
                transition: all 0.5s;
            }
            .ex2{
                position: relative;
                top: 27.6rem;
                left: 5.6rem;
                transition: all 0.5s;
            }
            .ex3{
                position: relative;
                top: 43.6rem;
                left: 23.6rem;
                transition: all 0.5s;
            }
            .activeX{
                fill: $colorRed;
                transform: rotate(45deg) scale(1.5);
            }

            @media only screen and (max-width: 1400px) {
                .ex1{
                    top: 23.6rem;
                    left: 17.6rem;
                }
                .ex2{
                    top: 27.6rem;
                    left: -.4rem;
                }
                .ex3{
                    top: 43.6rem;
                    left: 11.6rem;
                }
            }
            @media only screen and (max-width:1200px){
                display: none;
            }
            @media only screen and (max-width: 900px) {
                display: block;
                .ex1{
                    top: -.4rem;
                    left: 17.6rem;
                }
                .ex2{
                    top: 3.6rem;
                    left: 59.6rem;

                    @media only screen and (max-width: 700px) {
                        left: 47.6rem;
                    }
                }
                .ex3{
                    top: 55.6rem;
                    left: 11.6rem;
                }
            }
            @media only screen and (max-width: 600px) {
                display: block;
                .ex1{
                    top: 9.5rem;
                    left: 4.6rem;
                }
                .ex2{
                    top: 52.5rem;
                    left: 29.6rem;
                }
                .ex3{
                    top: 45.5rem;
                    left: 4.6rem;
                }
            }
            @media only screen and (max-width: 415px) {
                display: block;
                .ex1{
                    top: 9.5rem;
                    left: 4.6rem;
                }
                .ex2{
                    top: 47.5rem;
                    left: 24.6rem;
                }
                .ex3{
                    top: 40.5rem;
                    left: 4.6rem;
                }
            }
        }
        .svgLine{
            width: 100%;
            height: 100%;

            @media only screen and (max-width: 1400px) {
                display: none;
            }
        }
        .res{
            display: none;
            width: 100%;
            height: 100%;

            @media only screen and (max-width: 1400px) {
                display: block;
            }
            @media only screen and (max-width:1200px){
                display: none;
            }
        }
    }

    .right{
        width: 100%;
        overflow: hidden;
        box-shadow: -10px 0px 20px #ccc;
        align-self: center;
        // display: none;

        @media only screen and (max-width: 600px) {
            box-shadow: none;
        }

        img{
            width: 100%;
            height: 100%;
        }

        .slider{
            display: flex;
            width: 100%;
            height: 580px;

            @media only screen and (max-width: 900px) {
                width: 100%;
                height: auto;
            }
        }
    }
}

